import "../CSS/Home.css";
import {
    AdvancedChart,
    TickerTape,
    SymbolOverview,
} from "react-tradingview-embed";
import tempPhoto from "../PICTURES/headShot.png";
import { useState } from "react";
function App() {
    const [publicKey, setPublicKey] = useState("");
    const [privateKey, setPrivateKey] = useState("");
    const [detailsData, setDetailsData] = useState({});
    const [positionsData, setPositionData] = useState({});
    const ENDPOINT = "https://paper-api.alpaca.markets";

    console.log(publicKey, privateKey);
    const getDetails = async (e) => {
        var myHeaders = new Headers();
        myHeaders.append("APCA-API-KEY-ID", "PKIYIEQRI513Q1KOLVPJ");
        myHeaders.append(
            "APCA-API-SECRET-KEY",
            "oHkiE0bo3qy5QuoLo1QbLlcJmnN3g9u1vqNU6OS4"
        );

        var requestOptions = {
            method: "GET",
            headers: myHeaders,
            redirect: "follow",
        };

        await fetch(
            "https://paper-api.alpaca.markets/v2/account",
            requestOptions
        )
            .then((response) => response.json())
            .then((result) => {
                setDetailsData(result);
                console.log("here", detailsData);
            })
            .catch((error) => console.log("error", error));

        var myHeaders = new Headers();
        myHeaders.append("APCA-API-KEY-ID", "PKIYIEQRI513Q1KOLVPJ");
        myHeaders.append(
            "APCA-API-SECRET-KEY",
            "oHkiE0bo3qy5QuoLo1QbLlcJmnN3g9u1vqNU6OS4"
        );

        var requestOptions = {
            method: "GET",
            headers: myHeaders,
            redirect: "follow",
        };

        await fetch(
            "https://paper-api.alpaca.markets/v2/positions",
            requestOptions
        )
            .then((response) => response.json())
            .then((result) => {
                setPositionData(
                    // {
                    //     symbol: "AAPL",
                    //     exchange: "NASDAQ",
                    //     avg_entry_price: "210.0",
                    //     qty: "5",
                    //     side: "long",
                    //     market_value: "600.0",
                    //     unrealized_pl: "100.0",
                    //     unrealized_intraday_pl: "10.0",
                    //     current_price: "120.0",
                    // },
                    // {
                    //     symbol: "F",
                    //     exchange: "NASDAQ",
                    //     avg_entry_price: "24.0",
                    //     qty: "5",
                    //     side: "long",
                    //     market_value: "600.0",
                    //     unrealized_pl: "100.0",
                    //     unrealized_intraday_pl: "10.0",
                    //     current_price: "120.0",
                    // },
                    // {
                    //     symbol: "GME",
                    //     exchange: "NASDAQ",
                    //     avg_entry_price: "434.0",
                    //     qty: "5",
                    //     side: "long",
                    //     market_value: "600.0",
                    //     unrealized_pl: "100.0",
                    //     unrealized_intraday_pl: "10.0",
                    //     current_price: "120.0",
                    // },
                    // {
                    //     symbol: "GME",
                    //     exchange: "NASDAQ",
                    //     avg_entry_price: "434.0",
                    //     qty: "5",
                    //     side: "long",
                    //     market_value: "600.0",
                    //     unrealized_pl: "100.0",
                    //     unrealized_intraday_pl: "10.0",
                    //     current_price: "120.0",
                    // },
                    result
                );
                console.log("here", positionsData);
            })
            .catch((error) => console.log("error", error));
    };
    // console.log(detailsData);
    return (
        <div className="Home">
            <img className="winrate" src={tempPhoto}></img>
            <div className="details">
                <div className="one">
                    <input
                        placeholder="Enter Public Key..."
                        onChange={(e) => {
                            e.preventDefault();
                            setPublicKey(e.target.value);
                        }}
                    ></input>
                    <input
                        placeholder="Enter Private Key..."
                        onChange={(e) => {
                            e.preventDefault();
                            setPrivateKey(e.target.value);
                        }}
                    ></input>
                    <button onClick={getDetails}>Submit</button>
                </div>
                <div className="two">
                    <p>Account Number - </p>
                    <p>{detailsData.account_number}</p>
                </div>
                <div className="three">
                    <p>Equity - </p>
                    <p>{"$" + detailsData.equity}</p>
                </div>
                <div className="four">
                    <p>Buying Power - </p>
                    <p>{"$" + detailsData.buying_power}</p>
                </div>
                <div className="five">
                    <p>PDT - </p>
                    <p>{detailsData.daytrade_count}</p>
                </div>
            </div>

            <div className="chart">
                <SymbolOverview
                    widgetProps={{
                        isTransparent: true,
                        width: "100%",
                        height: "100%",
                        symbols: [
                            ["SPY", "AMEX:SPY|12M"],
                            ["Apple", "AAPL|1D"],
                            ["Google", "GOOGL|1D"],
                            ["Microsoft", "MSFT|1D"],
                        ],
                        theme: "dark",
                    }}
                />
            </div>
            <div className="positions">
                <div className="title">
                    <div>Positions</div>
                </div>
                <div className="position-items">
                    {positionsData.length > 0 ? (
                        positionsData.map((item) => {
                            return (
                                <div className="asset">
                                    <div className="symbol">{item.symbol}</div>
                                    <div className="class">
                                        <div>Exchange:</div>
                                        <div>{item.exchange}</div>
                                    </div>
                                    <div className="avg_price">
                                        <div>Avg Price:</div>
                                        <div>${item.avg_entry_price}</div>
                                    </div>
                                    <div className="qty">
                                        <div>Shares:</div>
                                        <div>{item.qty}</div>
                                    </div>
                                    <div className="side">
                                        <div>Side:</div> <div>{item.side}</div>
                                    </div>
                                    <div className="value">
                                        <div>Total Value:</div>
                                        <div>${item.market_value}</div>
                                    </div>
                                    <div className="unrealized_pl">
                                        <div>P&L:</div>
                                        <div>${item.unrealized_pl}</div>
                                    </div>
                                    <div className="unrealized_interday_pl">
                                        <div>Today P&L:</div>
                                        <div>
                                            ${item.unrealized_intraday_pl}
                                        </div>
                                    </div>
                                    <div className="price">
                                        <div>Current Price:</div>
                                        <div>${item.current_price}</div>
                                    </div>
                                </div>
                            );
                        })
                    ) : (
                        <div></div>
                    )}
                </div>
            </div>
        </div>
    );
}

export default App;

